import numpy as np
import skfuzzy as fuzz
import matplotlib.pyplot as plt

sistema_gestao_ambiental = np.arange(0, 101, 1)
sistema_gestao_ruim = fuzz.trapmf(sistema_gestao_ambiental, [0, 0, 40, 60])
sistema_gestao_medio = fuzz.trimf(sistema_gestao_ambiental, [40, 60, 80])
sistema_gestao_bom = fuzz.trapmf(sistema_gestao_ambiental, [60, 80, 100, 100])

imagem_ambiental = np.arange(0, 101, 1)
imagem_ambiental_ruim = fuzz.trapmf(imagem_ambiental, [0, 0, 40, 50])
