projeto_ambiental = np.arange(0, 101, 1)
projeto_ambiental_ruim = fuzz.trapmf(projeto_ambiental, [0, 0, 30, 50])
projeto_ambiental_media = fuzz.trimf(projeto_ambiental, [30, 50, 70])
projeto_ambiental_bom = fuzz.trapmf(projeto_ambiental, [50, 70, 100, 100])

selecionar = np.arange(0, 101, 1)
selecionar_nao = fuzz.trapmf(selecionar, [0, 0, 60, 80])
selecionar_sim = fuzz.trapmf(selecionar, [60, 80, 100, 100])


# Visualize these universes and membership functions
fig, (ax0, ax1, ax2, ax3) = plt.subplots(nrows=4, figsize=(8, 9))

ax0.plot(sistema_gestao_ambiental, sistema_gestao_ruim, 'r', linewidth=1.5, label='Ruim')
ax0.plot(sistema_gestao_ambiental, sistema_gestao_medio, 'g', linewidth=1.5, label='Media')
ax0.plot(sistema_gestao_ambiental, sistema_gestao_bom, 'b', linewidth=1.5, label='Bom')
ax0.set_title('Sistema de Gestao Ambiental')
ax0.legend()

ax1.plot(imagem_ambiental, imagem_ambiental_ruim, 'r', linewidth=1.5, label='Ruim')
ax1.plot(imagem_ambiental, imagem_ambiental_media, 'g', linewidth=1.5, label='Media')
ax1.plot(imagem_ambiental, imagem_ambiental_bom, 'b', linewidth=1.5, label='Bom')
ax1.set_title('Imagem Ambiental')
ax1.legend()

ax2.plot(projeto_ambiental, projeto_ambiental_ruim, 'r', linewidth=1.5, label='Ruim')
ax2.plot(projeto_ambiental, projeto_ambiental_media, 'g', linewidth=1.5, label='Media')
ax2.plot(projeto_ambiental, projeto_ambiental_bom, 'b', linewidth=1.5, label='Bom')
ax2.set_title('Projeto Ambiental')
ax2.legend()

ax3.plot(selecionar, selecionar_nao, 'r', linewidth=1.5, label='Nao Selecionar')
ax3.plot(selecionar, selecionar_sim, 'g', linewidth=1.5, label='Selecionar')
ax3.set_title('Selecionar')
ax3.legend()

# Turn off top/right axes
for ax in (ax0, ax1, ax2, ax3):
    ax.spines['top'].set_visible(False)
    ax.spines['right'].set_visible(False)
    ax.get_xaxis().tick_bottom()
    ax.get_yaxis().tick_left()

plt.tight_layout()

